import numpy as np
import matplotlib.pyplot as plt
from mne.stats import permutation_cluster_1samp_test, permutation_cluster_test

def plot_cluster_permutation_test(results1, results2, chance_level=0.5, alpha=0.05, 
                                 n_permutations=1000, title="Cluster Permutation Test", 
                                 save_path=None, n_windows=None, label_1='9m w2v', label_2='9m gpt2-large-svd',
                                 seed=42):
    """
    Performs a cluster permutation test between two results dictionaries and plots the results.
    
    Parameters
    ----------
    results1 : dict
        First results dictionary with structure {0: {0: [], 1: [], ..., 110: []}}
    results2 : dict
        Second results dictionary with structure {0: {0: [], 1: [], ..., 110: []}}
    chance_level : float, optional
        Chance level for the task, by default 0.5
    alpha : float, optional
        Significance level for the cluster permutation test, by default 0.05
    n_permutations : int, optional
        Number of permutations for the test, by default 1000
    title : str, optional
        Title for the plot, by default "Cluster Permutation Test"
    save_path : str, optional
        Path to save the figure, by default None (no saving)
    
    Returns
    -------
    fig : Figure
        The matplotlib figure object containing the plot
    significant_windows : list
        List of significant window indices from the cluster analysis
    """
    # Validate input data structure
    if 0 not in results1 or 0 not in results2:
        raise ValueError("Results dictionaries must contain key '0'")
    
    # Extract data from dictionaries and convert to arrays
    windows = sorted(results1[0].keys())
    print("Windows: ", windows)
    n_times = len(windows) 
    
    # Check that we have sample data for first window to determine n_subjects
    if len(results1[0][windows[0]]) == 0:
        raise ValueError("No sample data found in results")
    
    n_subjects = 49 #len(results1[0][windows[0]])
    print("Number of subjects: ", n_subjects)
    times = np.array(windows)
    
    # Initialize arrays
    data1 = np.zeros((n_subjects, n_times))
    data2 = np.zeros((n_subjects, n_times))
    print("Shape of data1: ", data1.shape)
    print("Shape of data2: ", data2.shape)
    # Fill arrays with data
    for i, t in enumerate(windows):
        # if len(results1[0][t]) != n_subjects or len(results2[0][t]) != n_subjects:
            # raise ValueError(f"Inconsistent number of samples in window {t}")
        data1[:, i] = np.array(results1[0][t][:n_subjects])
        data2[:, i] = np.array(results2[0][t][:n_subjects])
    
    # Compute difference between datasets (for cluster permutation test)
    # diff_data = data1 - data2
    
    # # diff_data = diff_data.T
    
    # # Perform cluster permutation test
    # # This maintains the window adjacency structure for proper clustering
    # t_obs, clusters, cluster_p_values, H0 = permutation_cluster_1samp_test(
    #     diff_data, n_permutations=n_permutations, threshold=None, 
    #     tail=0, out_type='mask'
    # )
    diff_data = [data1, data2]
    t_obs, clusters, cluster_p_values, H0 = permutation_cluster_test(
        diff_data, n_permutations=n_permutations, threshold=None, 
        tail=0, out_type='mask',
        seed=seed
    )
    
    print("Clusters: ", clusters)
    print("Cluster p-values: ", cluster_p_values)
    
    # Calculate mean and standard error
    mean1 = np.mean(data1, axis=0)
    mean2 = np.mean(data2, axis=0)
    sem1 = np.std(data1, axis=0) / np.sqrt(n_subjects)
    sem2 = np.std(data2, axis=0) / np.sqrt(n_subjects)
    
    # Create the plot
    fig, ax = plt.subplots(figsize=(10, 6))

    # Apply the 100-step shift to the x-coordinates
    shifted_times = times

    # Plot both result curves with shaded standard error (shifted by 100)
    ax.plot(shifted_times, mean1, 'b-', label=label_1)
    ax.fill_between(shifted_times, mean1 - sem1, mean1 + sem1, color='b', alpha=0.2)

    # Set x-axis ticks from -200 to 1000 with 200 step intervals
    # x_ticks = np.arange(-200, 1001, 200)
    # x_tick_labels = [str(tick) for tick in x_ticks]
    # ax.set_xticks(x_ticks)
    # ax.set_xticklabels(x_tick_labels)

    ax.plot(shifted_times, mean2, 'r-', label=label_2)
    ax.fill_between(shifted_times, mean2 - sem2, mean2 + sem2, color='r', alpha=0.2)

    # Plot chance level
    ax.axhline(chance_level, linestyle='--', color='k', label='Chance')
    
    # Set x-axis ticks from -200 to 1000 with 200 step intervals
    x_ticks = np.arange(-100, 1001, 200)
    x_tick_labels = [str(tick) for tick in x_ticks]
    # ax.set_xticks(x_ticks)
    ax.set_xticklabels(x_tick_labels)

    # Highlight significant clusters (also shifted by 100)
    significant_clusters_highlighted = False
    significant_windows = []
    
    labels = []

    for i_c, c in enumerate(clusters):
        if cluster_p_values[i_c] <= alpha:
            # Get indices of cluster timepoints
            cluster_inds = [c[0].start, c[0].stop - 1] 
            if len(cluster_inds) > 0:
                significant_windows.append([times[i] for i in cluster_inds])
                label = f'Significant (p = {cluster_p_values[i_c]:.3f})'
                labels.append(label)
                # Apply the shift to the highlight spans too
                ax.axvspan(shifted_times[cluster_inds[0]], shifted_times[cluster_inds[-1]], 
                        color='yellow', alpha=0.3)
                significant_clusters_highlighted = True
                print(f"Significant cluster found: windows {times[cluster_inds[0]]} to {times[cluster_inds[-1]]}, p={cluster_p_values[i_c]:.4f}")
                
                
    # Add the labels as text on the plot.
    y_pos = 0.75
    for i, window in enumerate(significant_windows):
        ax.text(window[0], y_pos, labels[i], fontsize=8, color='black')
        y_pos -= 0.05
                
    # # Create the plot
    # fig, ax = plt.subplots(figsize=(12, 6))
    
    # # Plot both result curves with shaded standard error
    # ax.plot(times, mean1, 'b-', label='Results 1')
    # ax.fill_between(times, mean1 - sem1, mean1 + sem1, color='b', alpha=0.2)
    
    # # Change x-ticks to window indices from -200 to 910 with a step of 100
    # x_ticks_labels = ['-200', '0', '200', '400', '600', '800', '1000']
    # ax.set_xticks([0, 20, 40, 60, 80, 100, 120])
    # ax.set_xticklabels(x_ticks_labels) 
        
    
    # ax.plot(times, mean2, 'r-', label='Results 2')
    # ax.fill_between(times, mean2 - sem2, mean2 + sem2, color='r', alpha=0.2)
    
    # # Plot chance level
    # ax.axhline(chance_level, linestyle='--', color='k', label='Chance')
    
    # # Highlight significant clusters
    # significant_clusters_highlighted = False
    # significant_windows = []
    
    # for i_c, c in enumerate(clusters):
    #     if cluster_p_values[i_c] <= alpha:
    #         # Get indices of cluster timepoints
    #         cluster_inds = [c[0].start, c[0].stop - 1]
    #         # import pdb; pdb.set_trace()
    #         if len(cluster_inds) > 0:
    #             significant_windows.append([times[i] for i in cluster_inds])
    #             label = f'Significant (p = {cluster_p_values[i_c]:.3f})' if not significant_clusters_highlighted else None
    #             ax.axvspan(times[cluster_inds[0]], times[cluster_inds[-1]], 
    #                        color='yellow', alpha=0.3, label=label)
    #             significant_clusters_highlighted = True
    #             print(f"Significant cluster found: windows {times[cluster_inds[0]]} to {times[cluster_inds[-1]]}, p={cluster_p_values[i_c]:.4f}")
    
    # Significant windows
    print("Significant windows: ", significant_windows)
    
    
    # Labels and styling
    ax.set_xlabel('Window')
    ax.set_ylabel('Accuracy')
    ax.set_title(title)
    ax.legend(loc='best')
    
    # Set axis limits
    ax.set_ylim(chance_level - 0.2, 0.8) 
    ax.set_xlim(shifted_times[0], shifted_times[-1])
    
    
    plt.tight_layout()
    
    # Save if required
    if save_path:
        # Check if the parent directory exists, if not create it
        import os
        parent_dir = os.path.dirname(save_path)
        if not os.path.exists(parent_dir):
            os.makedirs(parent_dir)
        plt.savefig(save_path, dpi=300, bbox_inches='tight')
    
    return fig, significant_windows

